let str = ''
str = str.split('');
let lengthArr = [];
for(let ch = 'a'.charCodeAt(0); ch <= 'z'.charCodeAt(0) ; ch++){
    let tempStr = [...str];
    
    let x = String.fromCharCode(ch)
    for(let i = 0 ; i<tempStr.length ; i++){
            if((x == tempStr[i]) || (x.toUpperCase() == tempStr[i]) || (x == tempStr[i].toLowerCase())){
                tempStr.splice(i, 1);
                i--;
            }
        }   
    while(true){
        var count =0;
        for(let i =0 ; i < tempStr.length-1 ; i++){
            if((tempStr[i] == tempStr[i+1].toLowerCase() && tempStr[i].toUpperCase() == tempStr[i+1]) ||
            (tempStr[i] == tempStr[i+1].toUpperCase() && tempStr[i].toLowerCase() == tempStr[i+1])
            ){        
                for(let k = i ; k < tempStr.length-2 ; k++){
                    tempStr[k] = tempStr[k+2];
                }
                for(let k=1; k<=2 ; k++){
                    tempStr.pop();
                }
                count++;
            }
        }
        if(count == 0){
            break;
        }
    }
    lengthArr.push(tempStr.length)
}
lengthArr.sort(function(a,b){return a-b})
console.log(lengthArr[0]);